/* eslint-disable arrow-parens */
import React from "react";
import PropTypes from "prop-types";
import clsx from "clsx";
import { Grid, makeStyles } from "@material-ui/core";

import CompositionInfo from "./CompositionInfo";
// import Emails from './Emails';
// import Invoices from './Invoices';
// import OtherActions from './OtherActions';

const useStyles = makeStyles(() => ({
	root: {},
}));

function Details({ className, documents, ...rest }) {
	const classes = useStyles();
	// console.log(documents);

	return (
		<Grid className={clsx(classes.root, className)} container spacing={3} {...rest}>
			{documents.map((document) => (
				<Grid item lg={4} md={6} xl={3} xs={12} key={document.documentID}>
					<CompositionInfo document={document} />
				</Grid>
			))}
		</Grid>
	);
}

Details.propTypes = {
	className: PropTypes.string,
	documents: PropTypes.array.isRequired,
};

export default Details;
